import styled from "styled-components";

export default function Categories() {
  return (
    <CategoriesContainer>
      <Divider>
        <div></div>
        <p>Categories</p>
      </Divider>
      <SectionTitle>Browse By Category</SectionTitle>
      <CategoriesList>
        <Image src={Apple} alt="Image" />
        <CategoriesName>Apple</CategoriesName>
      </CategoriesList>
    </CategoriesContainer>
  );
}

const CategoriesContainer = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: flex-start;
  margin-top: 60px;
  margin-bottom: 60px;
`;

const Divider = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
  color: #db4444;
  div {
    width: 20px;
    height: 32px;
    background-color: #db4444;
    border-radius: 5px;
  }
  p {
    margin-left: 12px;
    font-size: 16px;
  }
`;
const SectionTitle = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: center;
  margin: 20px 0px;
  font-size: 36px;
  font-weight: 600;
`;
const CategoriesList = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  margin: 60px 0px;
`;
const Category = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
  margin: 10px 0px;
  img {
    margin-right: 20px;
  }
  p {
    margin-left: 20px;
  }
`;
